	[20502]=[[{20502,"秘银",20500,0,0,2,{2},200,0,"锻造",{},{},"用于锻造<color='#ffff00'>80-100级装备</color>\n<color='#ffff9a'>病毒般的元素，在它的躯体中肆虐，最后，苦痛，铸就了蕴藏澎湃魔力的珍宝。</color>",30,0,2,{{tips = 2,val = "[{1;12002|2;副本;副本掉落;4}]"},{tips = 5,val = "[1]"},{tips = 3,val = "[1]"}},0,0,0,0}]],
