	[22694]=[[{22694,"大地之龙礼盒",22696,0,111,1,"",99,1,"获得奖励",{},{},"龙王挑战的证明，只有强大的勇士才配拥有，打开可获得<color='#ffff00'>银币*250000、英雄宝石*2及一份丰厚的随机奖励</color>",1,0,2,{{tips = 1,val = "[]"}},0,0,0,0}]],
	[22695]=[[{22695,"风龙挑战礼盒",22694,0,111,2,"",99,1,"获得奖励",{},{},"龙王挑战的证明，只有强大的勇士才配拥有，打开可获得<color='#ffff00'>银币*250000、英雄宝石*2及一份丰厚的随机奖励</color>",1,0,2,{{tips = 1,val = "[]"}},0,0,0,0}]],
	[22696]=[[{22696,"炎龙稀有礼盒",22694,0,111,3,"",99,1,"获得奖励",{},{},"龙王挑战的证明，只有强大的勇士才配拥有，打开可获得<color='#ffff00'>银币*250000、英雄宝石*3、随机图鉴*1及一份丰厚的随机奖励（有概率获得精灵珍魂、太阳护符等稀有物品）</color>",1,0,2,{{tips = 1,val = "[]"}},0,0,0,0}]],
	[22697]=[[{22697,"冰龙珍稀礼盒",22698,0,111,4,"",99,1,"获得奖励",{},{},"龙王挑战的证明，只有强大的勇士才配拥有，打开可获得<color='#ffff00'>银币*300000、英雄宝石*3、随机图鉴*1及一份丰厚的随机奖励（有概率获得精灵珍魂、太阳护符等稀有物品）</color>",1,0,2,{{tips = 1,val = "[]"}},0,0,0,0}]],
	[22698]=[[{22698,"龙王至尊礼盒",22698,0,111,4,"",99,1,"获得奖励",{},{},"龙王挑战的证明，只有强大的勇士才配拥有，打开可获得<color='#ffff00'>、银币*350000、英雄宝石*3、随机图鉴及一份丰厚的随机奖励（有概率获得精灵珍魂、太阳护符等稀有物品）</color>",1,0,2,{{tips = 1,val = "[]"}},0,0,0,0}]],
	[22699]=[[{22699,"英雄宝石礼盒",22534,0,111,3,"",99,1,"获得奖励",{},{},"装有英雄宝石的礼盒，打开可获得<color='#ffff00'>1~3个英雄宝石</color>",1,0,2,{{tips = 1,val = "[]"}},0,0,0,0}]],
	[22700]=[[{22700,"星座徽章",22700,0,0,4,"",200,0,"合成星座称号卡",{},{},"来自星座BOSS们的认可，只有击败<color='#ffff00'>7星</color>及以上星座BOSS，或星座挑战相关<color='#ffff00'>成就</color>中获得。可合成<color='#ffff00'>星座称号卡</color>。",50,0,2,{{tips = 2,val = "[{1;12002|3;十二星座;挑战7星以上星座BOSS;25}#{1;12500|2|7|4;星座成就;完成挑战星座成就;19}]"},{tips = 15,val = "[]"},{tips = 7,val = "[7|1]"}},10,0,0,0}]],
	[22710]=[[{22710,"勇敢的白羊",22710,0,0,4,"",99,1,"星座称号卡",{{effect_type = 9,val = {{30200,0,1000}}}},{},"白羊座称号卡，使用后可获得称号<color='#00ff00'>勇敢的白羊</color>。黄道第一宫的白羊座充满了新生儿的活力，勇敢、直率、热情，但也过于自我。\n持续时间：<color='#ffff00'>永久</color>\n<color='#23f0f7'>生命+10</color>",50,0,2,{{tips = 15,val = "[]"},{tips = 1,val = "[]"}},40,0,0,0}]],
	[22711]=[[{22711,"沉稳的金牛",22710,0,0,4,"",99,1,"星座称号卡",{{effect_type = 9,val = {{30201,0,1000}}}},{},"金牛座称号卡，使用后可获得称号<color='#00ff00'>沉稳的金牛</color>。黄道第二宫的金牛座沉稳，可靠，耐心十足，脚踏实地，但也缺乏应变。\n持续时间：<color='#ffff00'>永久</color>\n<color='#23f0f7'>物防+5</color>",50,0,2,{{tips = 15,val = "[]"},{tips = 1,val = "[]"}},40,0,0,0}]],
	[22712]=[[{22712,"灵敏的双子",22710,0,0,4,"",99,1,"星座称号卡",{{effect_type = 9,val = {{30202,0,1000}}}},{},"双子座称号卡，使用后可获得称号<color='#00ff00'>灵敏的双子</color>。双子座往往多才多艺，擅长沟通，适应力强，然而有时也会缺乏原则，善变圆滑。\n持续时间：<color='#ffff00'>永久</color>\n<color='#23f0f7'>魔防+4</color>\n<color='#23f0f7'>魔法+10</color>",50,0,2,{{tips = 15,val = "[]"},{tips = 1,val = "[]"}},40,0,0,0}]],
	[22713]=[[{22713,"友善的巨蟹",22710,0,0,4,"",99,1,"星座称号卡",{{effect_type = 9,val = {{30203,0,1000}}}},{},"巨蟹座称号卡，使用后可获得称号<color='#00ff00'>友善的巨蟹</color>。巨蟹座真挚细腻，忠诚善良，坚韧执着，有着不屈不挠的意志力；但也十分的情绪化，敏感，甚至易歇斯底里。\n持续时间：<color='#ffff00'>永久</color>\n<color='#23f0f7'>生命+10</color>",50,0,2,{{tips = 15,val = "[]"},{tips = 1,val = "[]"}},40,0,0,0}]],
	[22714]=[[{22714,"高贵的狮子",22710,0,0,4,"",99,1,"星座称号卡",{{effect_type = 9,val = {{30204,0,1000}}}},{},"狮子座称号卡，使用后可获得称号<color='#00ff00'>高贵的狮子</color>。狮子座热情、阳光、大方，自信，甚至有点自大，期待被仰慕被崇拜的感觉。\n持续时间：<color='#ffff00'>永久</color>\n<color='#23f0f7'>物防+5</color>",50,0,2,{{tips = 15,val = "[]"},{tips = 1,val = "[]"}},40,0,0,0}]],
	[22715]=[[{22715,"完美的处女",22710,0,0,4,"",99,1,"星座称号卡",{{effect_type = 9,val = {{30205,0,1000}}}},{},"处女座称号卡，使用后可获得称号<color='#00ff00'>完美的处女</color>。处女座有毅力，能坚持，追求自己的完美主义，生活决不能将就。\n持续时间：<color='#ffff00'>永久</color>\n<color='#23f0f7'>魔防+4</color>\n<color='#23f0f7'>魔法+10</color>",50,0,2,{{tips = 15,val = "[]"},{tips = 1,val = "[]"}},40,0,0,0}]],
	[22716]=[[{22716,"美丽的天秤",22710,0,0,4,"",99,1,"星座称号卡",{{effect_type = 9,val = {{30206,0,1000}}}},{},"天秤座称号卡，使用后可获得称号<color='#00ff00'>美丽的天秤</color>。天秤座常常追求平等、和谐，擅于察言观色，交际能力很强，但也容易面对选择总是犹豫不决。\n持续时间：<color='#ffff00'>永久</color>\n<color='#23f0f7'>生命+10</color>",50,0,2,{{tips = 15,val = "[]"},{tips = 1,val = "[]"}},40,0,0,0}]],
	[22717]=[[{22717,"神秘的天蝎",22710,0,0,4,"",99,1,"星座称号卡",{{effect_type = 9,val = {{30207,0,1000}}}},{},"天蝎座称号卡，使用后可获得称号<color='#00ff00'>神秘的天蝎</color>。天蝎座精力旺盛、占有欲极强，对于生活很有目标，不达到目的誓不罢休，复仇心理重，记仇。\n持续时间：<color='#ffff00'>永久</color>\n<color='#23f0f7'>物防+5</color>",50,0,2,{{tips = 15,val = "[]"},{tips = 1,val = "[]"}},40,0,0,0}]],
	[22718]=[[{22718,"自由的射手",22710,0,0,4,"",99,1,"星座称号卡",{{effect_type = 9,val = {{30208,0,1000}}}},{},"射手座称号卡，使用后可获得称号<color='#00ff00'>自由的射手</color>。射手座崇尚自由，勇敢、果断、独立，身上有一股勇往直前的劲儿。\n持续时间：<color='#ffff00'>永久</color>\n<color='#23f0f7'>魔防+4</color>\n<color='#23f0f7'>魔法+10</color>",50,0,2,{{tips = 15,val = "[]"},{tips = 1,val = "[]"}},40,0,0,0}]],
	[22719]=[[{22719,"聪慧的摩羯",22710,0,0,4,"",99,1,"星座称号卡",{{effect_type = 9,val = {{30209,0,1000}}}},{},"摩羯座称号卡，使用后可获得称号<color='#00ff00'>聪慧的摩羯</color>。坚强、理智、承受、隐忍，都是摩羯的代名词。会表现的酷酷的，与事隔离的样子，其实他们就是看不上你。\n持续时间：<color='#ffff00'>永久</color>\n<color='#23f0f7'>生命+10</color>",50,0,2,{{tips = 15,val = "[]"},{tips = 1,val = "[]"}},40,0,0,0}]],
